import '../style/Header.css'

const Header = () => {

    const navList = [
        {id: 1, text: 'Non-Profit', link: '#', active: false},
        {id: 2, text: 'Send Email', link: '#', active: false}
    ]

    const handleSelect = (id) => {
        console.log(`key: ${id}`);
        document.getElementById("list").childNodes.forEach()
    }

    return (
        <nav>
            <label>
                    Temelio Fund Manager
            </label>
            <ul>
                {navList.map((entry) => (
                    <li>
                        <a 
                            key={entry.id}
                            className={entry.active ? 'active': ''}
                            href={entry.link}
                            onClick={() => handleSelect(entry.id)}
                        >
                            {entry.text}
                        </a>
                    </li>
                ))}
            </ul>
        </nav>
    );
}

export default Header;
